#include <iostream>

using namespace std;

class Solution{
public:
    bool judgeCircle(char* moves) {
        int x=0, y=0;
        
        int length = strlen(moves);
        for(int i=0;i<length;i++){
            switch(moves[i]){
                case 'L': x-=1;break;
                case 'R': x+=1;break;
                case 'U': y+=1;break;
                case 'D': y-=1;break;
            }
        }
        if(x==0 && y==0) return true;
        return false;
    }
};

int main(int argc, const char * argv[]) {

    Solution solution;
    
    
    char* test ="";
    
    cout << solution.judgeCircle(test) << endl;
    
    return 0;
}



